import './App.css';
import Main from './Main';
import Aside from './Aside';
import Footer from './Footer';

function App() {
  return (
    <div className="App">
      <div className='asides'>
        <Aside className="aside" />
        <Main className="Main" />

      </div>
      <Footer />
    </div>
  );
}

export default App;
